import Fetch from './Fetch'

function Data() {


const [data,setdata]=useState()


useEffect(()=>{
    fetchdata()
},[])


async function fetchdata()
{
    Fetch.getdata().then(res=>{
        setdata(res)
    })
    .catch((err)=>{alert(err)})
}

  return (
    <div>
        {console.log(JSON.stringify(data))}
    </div>
  )
}

export default Data
